import {
  Link,
  Director
} from 'react-router';

const Login = () => {
  return (
    <form className="login" dir="ltr">
      <input className="login-input"
      type="text"
      placeholder="نام کاربری خود را وارد نمایید"
       />
      <input className="login-input"
      type="password"
      placeholder="رمز عبور خود را وارد نمایید"
      />
      <button className="login-input">ورود</button>
    </form>
  );
}

export default Login;
